window.bookSummaryJSON = "<p><i>The Dotari Salvation</i>, book 1:</p> <p>When the Terran Union has a mission that must not fail, it calls upon the Strike Marines. They are trained to improvise, adapt, overcome and win every fight.</p> <p>A deadly disease threatens the Dotari, Earth’s allies, with extinction. The cure lies in deep space, and Lieutenant Hoffman and his team will join the starship <i>Breitenfeld </i>as it journeys into the void and makes a desperate attempt to save the dying race. Lurking in the abyss is a threat that’s waited with inhuman patience. Hoffman must lead his Marines through a gauntlet and evade a foe designed to hunt and kill them.</p> <p><i>The Rage of Winter</i>, book 2:</p> <p>One Shot. One Kill. One sniper to strike fear in the heart of alien invaders.</p> <p>Hoffman’s Strike Marines pursue enemy agents across a wintry world, desperate to stop an insidious threat festering in the heart of the Terran Union. Their hunt is disrupted when the fanatical Kesaht invade and the team is split across the snow and ice of a harsh planet. The team’s sniper, Duke, plays a deadly game of hit-and-run to slow the aliens' advance and earns the ire of the enemy commander. Hoffman, trapped in the frigid wilds, leads his Marines and their cunning prisoners back to the front, where they must join the fight against the Kesaht before the planet is lost.</p> <p><i>Terran Strike Marines: Publisher's Pack</i> is an action-packed military science-fiction adventure set in the best-selling Ember War universe.</p>"; 
